import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function List(props){


    // console.log(props.todos);

    const obj = Object.entries(props.todos);
    const items = [];

    if(obj != null){
        obj.forEach(([key, value]) => {
                items.push(<Text onPress={props.onRemove.bind(this, key)} style={styles.items} key={key}>{value.text}</Text>)
        });
    }else{
        items.push(<Text style={styles.items} >NO ITEM</Text>)
    }


        // console.log(list);

 return(
  <View  style={styles.container}>
      { items }
  </View>
 );
}

const styles = StyleSheet.create({
    container: {

    },
    items: {
        width: '100%',
        padding: 10,
        backgroundColor: '#FFF',
        marginVertical: 2,
        borderRadius: 5
    }
})
